import React from "react";

class Menu extends React.Component {
  render() {
    return (
      <div className="menu">
        <Header tagline="Fresh Seafood Market" />
        <ul className="fishes">
          {Object.keys(this.state.fishes).map(fish => (
            <Fish key={fish} fishDetails={this.state.fishes[fish]} />
          ))}
        </ul>
      </div>
    );
  }
}

export default Menu;
